import React ,{ Component } from 'react';
import { Link } from 'react-router-dom'
import Map from './map'
import {addMarker} from './config'

class Search extends Component {
    
    constructor(){
        super()
        this.state={
            searchTerm:''
        }
    }

    render(){
        const { addLocation }=this.props
        const {searchTerm} =this.state

        return <div className='search-page'>
                   <div className='search-container'>
                       <Link to='/'>返回</Link>
                       <input type='text' 
                              value={this.searchTerm} 
                              onChange={(event)=>{
                                  this.setState({searchTerm:event.target.value})
                              }}/>
                        <button onClick={
                            ()=>{console.log(searchTerm);addMarker(searchTerm)}
                        }>Search</button>
                    </div>
                   <div id='map'>
                       <Map></Map>
                       <div className='add-location'>
                           <span className='city-name'>新绛</span>
                           <span className='add-buttom' onClick={(searchTerm)=>{console.log(searchTerm)}} >add</span>
                       </div>
                   </div>
               </div>
    }
}

export default Search
